package com.company;

public class ifElse {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int number1=50;
		int number2=10;
		int number3=20;
		
		if(number1 < number2 && number2 < number3) {
			System.out.println("Esto es verdadero");
		}
			else {
			System.out.println("Esto es falso");
				}
		System.out.println("Fin");
	}

}
